import React from 'react';
import * as animation from '../Assets/animation.jpg';
import { Grid, Item, Header, Image} from 'semantic-ui-react';



class LandingPage extends React.Component {
    render () {
		return (
            <Grid celled>
    <Grid.Row>
      <Grid.Column width={3}>
        <Image src={animation} />
      </Grid.Column>
      <Grid.Column width={13}>
      <Image src={animation} />
      </Grid.Column>
    </Grid.Row>

    <Grid.Row>
      <Grid.Column width={3}>
      <Image src={animation} />      </Grid.Column>
      <Grid.Column width={10}>
      <Image src={animation} />      </Grid.Column>
      <Grid.Column width={3}>
      <Image src={animation} />      </Grid.Column>
    </Grid.Row>
  </Grid>
        );
    }
}

export default LandingPage
